import { En_Hero } from "../comps/Portal";
import { charging } from "../constants";

const Charging = () => {
  return (
    <>
      <En_Hero
        prod={charging}
        title="Charging"
        subtitle="Go Anywhere, Charge Everywhere"
        get={Charging.getLink}
      />
    </>
  );
};

export default Charging;
